import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Form0 from "./components/Form0";
import Step1 from "./components/Step1";

export default function App() {
  return (
    <Router>
      <div>

        <Switch>
          <Route path="/step1">
            <Step1 />
          </Route>
          <Route path="/">
            <Form0 />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
